    const [title, setTitle] = useState('');


const clickHandler = (title) => {
    return (
         setTitle(title)
    )}

    return(
        <div>
            <ListBox clickHandler={clickHandler} framing={framing} />
            <h1>{title}</h1>

        </div>
    )
}

export default PlateDisplay;
